  //     <tbody>      
  //     {this.state.schoolData.map(function(item, key) {
  //              return (
  //                 <tr key = {key}>
  //                     <td>{item.name}</td>
  //                     <td>{item.countryID}</td>
  //                     <td>{item.regionID}</td>
  //                     <td>{item.schoolCode}</td>
  //                 </tr>
  //               )             
  //            })}</tbody>
  //      </table>
  //   );
  // }
}

SchoolTable.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(SchoolTable);
